import React, { Component } from 'react'

export class Start extends Component {

    constructor(props) {
        super(props)
    
        this.state = {
             username:''
        }
    }
    

    render() {
        return (
            <div>
                    <h1>Welcome to the Quiz</h1><br />
                    Enter your username to start <br />
                    <input  
                    type='text'
                    onChange={e => setName({username: e.target.value})} 
                    value={name.username} />
                    <br />

                    <button onChange >Start Game</button>
            </div>
        )
    }
}

export default Start
